import React from "react";

const LatestPosts = ({posts}) => {
  return (
    <div class="columns-3">
      <h2>Latest Posts</h2>
      {posts.map((post) => (
        <div>
          <h3 key={post._id}>{post.title}</h3>
          <p>{post.content}</p>
          <p>Published On: {new Date(post.createdAt).toLocaleDateString()}</p>
        </div>
      ))}
    </div>
  );
};

export default LatestPosts;
